class Ui_Form_6(object):
    def Probleme_direct(self):

        phi1d = float(self.lineEdit.text())
        phi1m = float(self.lineEdit_2.text())
        phi1s = float(self.lineEdit_3.text())

        A12d = float(self.lineEdit_7.text())
        A12m = float(self.lineEdit_8.text())
        A12s = float(self.lineEdit_9.text())

        s = float(self.lineEdit_10.text())

        lambda_1d = float(self.lineEdit_4.text())
        lambda_1m = float(self.lineEdit_5.text())
        lambda_1s = float(self.lineEdit_6.text())

        if self.comboBox.currentText() == "WGS 84":
            a = 6378137
            b = 6356752.314
            E = 4 * ((b * b) * pi * 1.00465)
        elif self.comboBox.currentText() == "Clarke 1880":
            a = 6378249.20
            b = 6356515.0
            E = 4 * ((b * b) * pi * 1.00465)

        if self.comboBox_2.currentText() == "Rayon moyen de Gauss":
            rayon = calcul_rayons.calcul_rayon_Gauss(a, b)
            sigma12 = s / rayon
        elif self.comboBox_2.currentText() == "Rayon moyen des demi-axes":
            rayon = calcul_rayons.calcul_rayon_moyen(a, b)
            sigma12 = s / rayon
        elif self.comboBox_2.currentText() == "Rayon d\'une sphère de  même superficie que l\'ellipsoïde":
            rayon = calcul_rayons.calcul_rayon_a(E)
            sigma12 = s / rayon
        elif self.comboBox_2.currentText() == "Rayon d\'une sphère de  même volume que l\'ellipsoïde":
            rayon = calcul_rayons.calcul_rayon_v(a, b)
            sigma12 = s / rayon

        phi1 = Conversion.dms2rad2(phi1d, phi1m, phi1s)
        lambda_1 = Conversion.dms2rad2(lambda_1d, lambda_1m, lambda_1s)
        A12 = Conversion.dms2rad2(A12d, A12m, A12s)

        # DETERMINATION DE LA LATITUDE DU POINT P2

        sinphi2=sin(phi1)*cos(sigma12)+cos(phi1)*sin(sigma12)*cos(A12)
        sinphi2=asin(sinphi2)

        (phi2d, phi2m, phi2s) = Conversion.rad2dms2(sinphi2)


        """An = cos((pi / 2) - phi1) * cos(sigma12) + sin((pi / 2) - phi1) * sin(sigma12) * cos(A12)
        sinPhi2 = sin(phi1) * cos(sigma12) + cos(phi1) * sin(sigma12) * cos(A12)
        phi2_rad = asin(sinPhi2)
        (phi2d, phi2m, phi2s) = Conversion.rad2dms(phi2_rad)"""

        # DETERMINATION DE LA Longitude DU POINT P2

        cot_lambda2 = 1 / sin(A12) * (mp.cot(sigma12)*sin(pi/2-phi1)-cos(pi/2-phi1)*cos(A12))
        lambda_2_rad = lambda_1 + mp.acot(cot_lambda2)
        (lambda_2d, lambda_2m, lambda_2s) = Conversion.rad2dms(lambda_2_rad)

        """cot_lambda2 = (1 / sin(A12)) * (1 / (tan(sigma12) * sin((pi / 2) - phi1)) - cos((pi / 2) - phi1) * cos(A12))
        arcot1 = pi / 2 - atan(cot_lambda2)
        lambda_2_rad = lambda_1 + arcot1
        (lambda_2d, lambda_2m, lambda_2s) = Conversion.rad2dms(lambda_2_rad)"""

        # DETERMINATION DE L'AZIMUT DU POINT P2
        # A21=1/atan(1/sin(A12)*(cos(sigma12)*cos(A12)-tan(phi1)*sin(sigma12)))*180/pi
        cot_A21 = 1 / sin(A12) * (cos(sigma12) * cos(A12) - tan(phi1) * sin(sigma12))
        A21_rad = pi / 2 - atan(cot_A21)
        (A21_d, A21_m, A21_s) = Conversion.rad2dms(A21_rad)

        self.lineEdit_13.setText(str(phi2d))
        self.lineEdit_14.setText(str(phi2m))
        self.lineEdit_15.setText(str(phi2s))

        self.lineEdit_16.setText(str(lambda_2d))
        self.lineEdit_17.setText(str(lambda_2m))
        self.lineEdit_18.setText(str(lambda_2s))

        self.lineEdit_19.setText(str(A21_d))
        self.lineEdit_20.setText(str(A21_m))
        self.lineEdit_21.setText(str(A21_s))

